Extreme Weight Loss
Season 3 , Episode 8 - &quot;Trina&quot;

Four out of five African American women are overweight or obese, but Chantell is determined to defy those odds. With her trademark flower in her hair, the 25-year-old, personable Chantell from Chicago, IL has always stood out as a stylish young lady. Now she no longer wants to use clothes to hide her 327 pounds. Her mother and other family members - with a history of obesity, diabetes and heart disease - don't believe Chantell has a real weight problem... until she gets on the scale. Chantell is committed to change and inspires her mother to start her own fitness regimen. She is ecstatic when trainer Chris Powell chooses her to go on a weight loss journey. If she makes her 90-day weight loss goal, Chris is prepared to reward her with a shopping spree in Paris, France, where she can fulfill another dream of running a marathon. As a thank you to Chris for all heÃ¢â‚¬â„¢s done, Chantell catches him off guard and gives him a surprise of her own. There are struggles along the way, including facing her apartment building's eviction notice right before her 90-day weigh-in and difficulty in balancing weight loss with her senior year in college. Chantell knows she must lose the weight or she could lose her life, and hopes her passion and commitment will lead her to success.
